x20//\x20改为动态加载\x0a\x20\x20\x20\x20\x20\x20\x20\x20let\x20testResults\x20=\x20[];\x0a\x20\x20\x20\x20\x20\x20\x20\x20let\x20displayedResults\x20=\x20[];\x20//\x20新增：存储当前显示的结果\x0a\x20\x20\x20\x20\x20\x20\x20\x20let\x20showingAll\x20=\x20false;\x20//\x20新增：标记是否显示全部内容\x0a\x20\x20\x20\x20\x20\x20\x20\x20let\x20currentDisplayType\x20=\x20\x27loading\x27;\x20//\x20新增：当前显示类型\x20\x27loading\x27\x20|\x20\x27results\x27\x0a\x20\x20\x20\x20\x20\x20\x20\x20let\x20cloudflareLocations\x20=\x20{};\x20//\x20新增：存储Cloudflare位置信息\x0a\x20\x20\x20\x20\x20\x20\x20\x20\x0a\x20\x20\x20\x20\x20\x20\x20\x20//\x20新增：本地存储管理\x0a\x20\x20\x20\x20\x20\x20\x20\x20const\x20StorageKeys\x20=\x20{\x0a\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20PORT:\x20\x27cf-ip-test-port\x27,\x0a\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20IP_SOURCE:\x20\x27cf-ip-test-source\x27\x0a\x20\x20\x20\x20\x20\x20\x20\x20};\x0a\x20\x20\x20\x20\x20\x20\x20\x20\x0a\x20\x20\x20\x20\x20\x20\x20\x20//\x20新增：加载Cloudflare位置信息\x0a\x20\x20\x20\x20\x20\x20\x20\x20async\x20function\x20loadCloudflareLocations()\x20{\x0a\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20try\x20{\x0a\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20const\x20response\x20=\x20await\x20fetch(\x27https://speed.cloudflare.com/locations\x27);\x0a\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20if\x20(response.ok)\x20{\x0a\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20const\x20locations\x20=\x20await\x20response.json();\x0a\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20//\x20转换为以iata为key的对象，便于快速查找\x0a\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20cloudflareLocations\x20=\x20{};\x0a\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20locations.forEach(location\x20=>\x20{\x0a\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20cloudflareLocations[location.iata]\x20=\